import React from 'react';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const App = ()=>{
    return(
    <Router>
        <Switch>
            <Route exact path="/home"><Home/></Route>
        </Switch>
    </Router>
    
    )
}

export default App
